            <Form onChange={handleDateChange}value={productDate}>
              <Form.Check
                type="radio"
                name="date"
                label="Siste 24 timer"
                value="today"
                defaultChecked={productDate === 'today'}
              />
              <Form.Check
                type="radio"
                name="date"
                label="I uke"
                value="this week"
                defaultChecked={productDate === 'this week'}
              />
              <Form.Check
                type="radio"
                name="date"
                label="I month"
                value="this month"
                defaultChecked={productDate === 'this month'}
              />
            </Form>
          </Accordion.Body>
        </Accordion.Item>
      </Accordion>

      <Accordion className="filter-accordion">
        <Accordion.Item>
          <Accordion.Header>Status</Accordion.Header>
          <Accordion.Body>
            <Form>
              <Form.Check type="radio" name="status" label="Nytt"></Form.Check>
              <Form.Check type="radio" name="status" label="Brukt"></Form.Check>
            </Form>
          </Accordion.Body>
        </Accordion.Item>
      </Accordion>
    </div>
  );
